net.trainParam.epochs=1000; %(number of epochs)


% Choose Input and Output Pre/Post-Processing Functions
net.input.processFcns = {'removeconstantrows','mapminmax'};
net.output.processFcns = {'removeconstantrows','mapminmax'};

% Setup Division of Data for Training, Validation, Testing
net.divideFcn = 'dividerand';  % Divide data randomly
net.divideMode = 'sample';  % Divide up every sample
net.divideParam.trainRatio = 65/100; % Percentage of Samples in 'Training'
net.divideParam.valRatio = 15/100; % Percentage of Samples in 'Validation'
net.divideParam.testRatio = 20/100; % Percentage of Samples in 'Test'

% Choose a Performance Function
net.performFcn = 'mse';  % Mean Squared Error

% Choose Plot Functions
net.plotFcns = {'plotperform','plottrainstate','ploterrhist', ...
    'plotregression', 'plotfit'};

% Train the Network
[net,tr] = train(net,x,t);

% Test the Network
y = net(x);
e = gsubtract(t,y);
performance = perform(net,t,y)

% Recalculate Training, Validation and Test Performance
trainTargets = t .* tr.trainMask{1};
valTargets = t .* tr.valMask{1};
testTargets = t .* tr.testMask{1};
trainPerformance = perform(net,trainTargets,y)
valPerformance = perform(net,valTargets,y)
testPerformance = perform(net,testTargets,y)

%Get Predicted Outputs of Test
a = sim(net,x)
[t,a]



%Creating Matrices to Hold All the Train and Test Data
testInd = tr.testInd;
AllInputDataForTestDataset = x(:,testInd);
AllTargetDataForTestDataset = t(:,testInd);
trainInd = tr.trainInd;
AllInputDataForTrainDataset = x(:,trainInd);
AllTargetDataForTrainDataset = t(:,trainInd);

PredictionAnswersTrain = sim(net,AllInputDataForTrainDataset);
[AllTargetDataForTrainDataset,PredictionAnswersTrain];
PredictionAnswersTest = sim(net,AllInputDataForTestDataset);
[AllTargetDataForTestDataset,PredictionAnswersTest];

